const supertest = require("supertest")
const expect = require('chai').expect;
const tranglevalues = require('../testdata/trianglevalues.json');

const request = supertest('http://ew1eppqaassignment-env.eba-rqr3rd8p.eu-west-1.elasticbeanstalk.com/');

describe('Triangle Calculator POST  test',() => {
    it('Validate equilateral triangle status', (done) => {
        request.post('').send(tranglevalues.equilateral).end((err,res) => {
            //console.log(res);
            expect(res.statusCode).to.be.equal(200);
            done();
        });
    });

    it('Validate isosceles triangle status', (done) => {
        request.post('').send(tranglevalues.isosceles).end((err,res) => {
            //console.log(res);
            expect(res.statusCode).to.be.equal(200);
            done();
        });
    });

    it('Validate versatile triangle status', (done) => {
        request.post('').send(tranglevalues.versatile).end((err,res) => {
            //console.log(res);
            expect(res.statusCode).to.be.equal(200);
            done();
        });
    });

    it('Validate equilateral triangle type identification result', (done) => {
        request.post('').send(tranglevalues.equilateral).end((err,res) => {
            //console.log(res);
            expect(res._body.result).to.be.equal('This is equilateral triangle');
            done();
        });
    });

    it('Validate isosceles triangle type identification result', (done) => {
        request.post('').send(tranglevalues.isosceles).end((err,res) => {
            //console.log(res);
            expect(res._body.result).to.be.equal('This is isosceles triangle');
            done();
        });
    });

    it('Validate versatile triangle type identification result', (done) => {
        request.post('').send(tranglevalues.versatile).end((err,res) => {
            //console.log(res);
            expect(res._body.result).to.be.equal('This is versatile triangle');
            done();
        });
    });
})

